import classes from './main.module.css'
import Svg from '../../assets/svg/add'


const Main = () => {
    return (
        <div className={classes.main}>
            <div className={classes.buttonsContainer}>
                <div className={classes.plusButton}>
                    {Svg.addSvg}
                </div>
                <div className={classes.filesButton}>
                   {filesBtn()}
                </div>
            </div>
        </div>
    )
}

export default Main
